    var layerInUse = layer1;
    for (var i = 0, len = layerInUse.length; i < len; i++) {
//            console.log(i);
//            console.log(layerInUse[i]);//var el = layerInUse[i];
        if (typeof layerInUse[i].transform() != 'undefined') {
//            console.log (layerInUse[i].transform());
            layerInUse[i]['originalForm'] = layerInUse[i].transform();
            layerInUse[i]['attributeFill'] = layerInUse[i].attr('fill');
//            console.log(layerInUse[i]['attributeFill']);
            layerInUse[0].data("hovered", false);
//            console.log('here');
//            console.log(layerInUse[i]);
//            console.log(layerInUse[i]['originalForm']);
//            console.log('there');
            layerInUse[i].mouseover(function () {
//                console.log('mouseover');

                if (!layerInUse[0].data("hovered")) {
                    layerInUse[0].data("hovered", true);

                    var mydata = this.data('id').replace(/_/g, '\n');
                    text = rsr.text(360, 50, mydata).attr({fill: '#57a946', 'font-size': '20px' })
                    layerInUse.push(text);
                    text.animate({
                        x: '200',
                        y: '50'
                    }, 600);
                    this.toFront();
                    this.attr({
                        cursor: 'pointer',
                        fill: '#9ada8d',
                        stroke: '#fff',
                        'stroke-width': '1.1'
                    });


                    this.animate({
                        transform: this['originalForm'].toString() + "s1.2,1.2"
                    }, 200, 'ease');
                }
            });
            $layerObj = $(layerInUse[i]);
            layerInUse[i].mouseout(function () {
//                console.log('mouseout');
                this.animate({
                    scale: '0.05'
                }, 200);
                this.attr({
                    fill: this['attributeFill'],
                    'stroke-width': '0',
                });
                this.animate({
                    transform: this['originalForm'].toString()
                }, 200, 'ease');
                text.remove();
                layerInUse[0].data("hovered", false);
            });

            layerInUse[i].click(function () {
                var mydata = this.data('id').replace(/_/g, ' ');
                //$("#Form_NatGasPricingForm_District option:text="+mydata+"").prop('selected', true);
                $("#Form_NatGasPricingForm_District option").filter(function () {
                    //may want to use $.trim in here
                    if ($(this).text() == mydata) {
                        console.log($(this).text() + ' match');
                        return true;
                    }
                }).prop('selected', true).val(mydata);
                $('#Form_NatGasPricingForm_District').trigger('change',true);
                $('#Form_NatGasPricingForm_Suburb').trigger('change');

                this.animate({
                    fill: 'green'
                }, 200);
            });
        }
    }


